import React from "react";
import Carousel from 'react-bootstrap/Carousel';
import "react-bootstrap-carousel/dist/react-bootstrap-carousel.css";
import './Main.css'
import image1 from "./img/1.jpg"
import image2 from "./image/LWL_Campus_2020.jpg"
import image3 from "./image/LWL_Campus_2020.jpg"
import {useMediaQuery} from "react-responsive";

import {Desktop} from "../components/desktop/desktop.component";
import {Laptop} from "../components/laptop/laptop.component";
import {BigScreen} from "../components/big-screen/big-screen.component";
import {Mobile} from "../components/mobile/mobile.component";
import {TabletMobile} from "../components/tablet-mobile/tablet-mobile.component";

function App() {
    const isMobileDevice = useMediaQuery({
        query: "(min-device-width: 480px)",
    });

    const isTabletDevice = useMediaQuery({
        query: "(min-device-width: 768px)",
    });

    const isLaptop = useMediaQuery({
        query: "(min-device-width: 1024px)",
    });

    const isDesktop = useMediaQuery({
        query: "(min-device-width: 1200px)",
    });

    const isBigScreen = useMediaQuery({
        query: "(min-device-width: 1201px )",
    });

    return (
        <div className="App">
            {isMobileDevice && <Mobile/>}
            {isTabletDevice && <>
                <TabletMobile/>
                {isDesktop && <Desktop/>}
                {isLaptop && <Laptop/>}
                {isBigScreen && <BigScreen/>}
            </>}
        </div>); }

const Main = () => (

    <div className="mh-90 center" style={{width: 1000, height: 20}}>
        <Carousel>
            <Carousel.Item>
                <img
                    className="d-block w-100"
                    src={image2}
                    alt="First slide"
                />
                <Carousel.Caption>
                    <h3>First slide label</h3>
                    <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
                <img
                    className="d-block w-100"
                    src={image1}
                    alt="Second slide"
                />

                <Carousel.Caption>
                    <h3>Second slide label</h3>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
                <img
                    className="d-block w-100"
                    src={image3}
                    alt="Third slide"
                />\

                <Carousel.Caption>
                    <h3>Third slide label</h3>
                    <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
                </Carousel.Caption>
            </Carousel.Item>
        </Carousel>
    </div>
);

export default Main;
